import React from 'react';
import axios from 'axios';

const SignUpForm = () => {
  const handleSubmit = (e) => {
    e.preventDefault();

    const message = "Hello, backend!";

    axios.post('/signup', message)
      .then(response => {
        console.log(response.data); // Assuming the backend responds with JSON data
      })
      .catch(error => {
        console.error(error);
      });
  };

  return (
    <form onSubmit={handleSubmit}>
      <button type="submit">Print Message</button>
    </form>
  );
};

export default SignUpForm;
